INSERT INTO `email_templates` (`id`, `name`, `slug`, `subject`, `email_body`, `sms_body`, `notification_body`, `shortcode`, `email_status`, `sms_status`, `notification_status`, `template_mode`, `created_at`, `updated_at`) VALUES
(1, 'Invite User', 'INVITE_USER', 'You\'ve been invited to collaborate', '<h2>Invitation to collaborate</h2><p>{{businessName}} has invited you to collaborate as {{roleName}}</p><p>{{message}}</p><p>Accept the invitation by clicking the button below.</p><p><a href=\'{{actionUrl}}\' style=\'box-sizing: border-box; position: relative; -webkit-text-size-adjust: none; border-radius: 4px; color: #fff; display: inline-block; overflow: hidden; text-decoration: none; background-color: #2d3748; border-bottom: 8px solid #2d3748; border-left: 18px solid #2d3748; border-right: 18px solid #2d3748; border-top: 8px solid #2d3748;\'>Accept Invitation</a></p><p class=\'subcopy\' style=\'word-break: break-all; font-size: 14px;\'>If you\'re having trouble clicking the \'Accept Invitation\' button, copy and paste the URL below into your web browser: <a href=\'{{actionUrl}}\'>{{actionUrl}}</a></p>', '', '', '{{businessName}} {{roleName}} {{message}} {{actionUrl}}', 0, 0, 0, 1, NULL, NULL),
(2, 'New Invoice Created', 'NEW_INVOICE_CREATED', 'New Invoice Created', '<div style=\'font-family: Arial, sans-serif; font-size: 14px;\'> <h2 style=\'color: #333333;\'>New Invoice Created</h2> <p>Dear {{customerName}},</p> <p>I am writing to let you know that a new invoice has been created for the Product/Service you ordered. The details of the invoice are as follows:</p> <ul> <li>Invoice number: <strong>{{invoiceNumber}}</strong></li> <li>Invoice date: <strong>{{invoiceDate}}</strong></li> <li>Due date: <strong>{{dueDate}}</strong></li> <li>Total amount due: <strong>{{dueAmount}}</strong></li> </ul> <p>To make the payment, please use the following details:</p> <p>{{invoiceLink}}</p> <p>Thank you for your business. We appreciate your prompt payment.</p> </div>', '', '', '{{customerName}} {{invoiceNumber}} {{invoiceDate}} {{dueDate}} {{dueAmount}} {{invoiceLink}}', 0, 0, 0, 1, NULL, NULL),
(3, 'New Quotation Created', 'NEW_QUOTATION_CREATED', 'New Quotation Created', '<div style=\'font-family: Arial, sans-serif; font-size: 14px;\'> <h2 style=\'color: #333333;\'>New Quotation Created</h2> <p>Dear {{customerName}},</p> <p>I am pleased to inform you that we have created a new quotation for the Product/Service you requested. The details of the quotation are as follows:</p> <ul> <li>Quotation number: <strong>{{quotationNumber}}</strong></li> <li>Quotation date: <strong>{{quotationDate}}</strong></li> <li>Quotation expiry date: <strong>{{expiryDate}}</strong></li> <li>Total amount: <strong>{{amount}}</strong></li> </ul> <p>Please note that this quotation is valid until <strong>{{expiryDate}}</strong>. If you have any questions regarding the quotation, please do not hesitate to contact us.</p> <p><a href=\'{{quotationLink}}\'>View Quotation</a></p> <p>To proceed with the order, please confirm your acceptance of the quotation by replying to this email. Once we receive your confirmation, we will proceed with the order and send you the invoice.</p> <p>Thank you for your interest in our products/services. We look forward to doing business with you.</p> </div>', '', '', '{{customerName}} {{quotationDate}} {{expiryDate}} {{amount}} {{quotationNumber}} {{quotationLink}}', 0, 0, 0, 1, NULL, NULL),
(4, 'Invoice Payment Reminder', 'INVOICE_PAYMENT_REMINDER', 'Invoice Payment Reminder', '<div style=\'font-family: Arial, sans-serif; font-size: 14px;\'> <h2 style=\'color: #333333;\'>Invoice Payment Reminder</h2> <p>Dear {{customerName}},</p> <p>I hope this email finds you well. This message is to remind you that the payment for invoice <strong>{{invoiceNumber}}</strong> is now due.</p> <p>The total amount due is <strong>{{dueAmount}}</strong>. Please ensure that the payment is made promptly to avoid any late fees or penalties.</p> <p>To make the payment, kindly use the following details:</p> <p>{{invoiceLink}}</p> <p>If you have already made the payment, please disregard this email.</p> <p>Thank you for your prompt attention to this matter. If you have any questions or concerns, please do not hesitate to contact me.</p></div>', '', '', '{{customerName}} {{invoiceNumber}} {{invoiceDate}} {{dueDate}} {{dueAmount}} {{invoiceLink}}', 0, 0, 0, 1, NULL, NULL),
(5, 'Invoice Payment Received', 'INVOICE_PAYMENT_RECEIVED', 'Invoice Payment Received', '<div style=\'font-family: Arial, sans-serif; font-size: 14px;\'> <h2 style=\'color: #333333;\'>Invoice Payment Received</h2> <p>Dear {{customerName}},</p> <p>I am writing to confirm that we have received your payment for invoice <strong>{{invoiceNumber}}</strong>.</p> <p>The total amount received is <strong>{{amount}}</strong>.</p> <p>Thank you for your prompt payment. We value your business and look forward to working with you again in the future.</p> <p>If you have any questions or concerns, please do not hesitate to contact us.</p></div>', '', '', '{{customerName}} {{amount}} {{invoiceDate}} {{paymentMethod}} {{invoiceNumber}} {{invoiceLink}}', 0, 0, 0, 1, NULL, NULL),
(6, 'Trial Period Ended', 'TRIAL_PERIOD_ENDED', 'Dot Accounts Trial Ended', '<div style=\'font-family: Arial, sans-serif; font-size: 14px;\'> <h2 style=\'color: #333333;\'>Dot Accounts Trial Ended</h2> <p>Dear {{customerName}},</p> <p>We hope this email finds you well. We wanted to remind you that your trial period has ended as of {{trialEndDate}}.</p> <p>We hope you found our service useful during the trial period. If you would like to continue using our service, please pay for subscription.</p> <p>If you have any questions or concerns, please do not hesitate to contact us. We are always here to help.</p> <p>Thank you for your interest in our service. We hope to continue serving you in the future.</p> </div>', '', '', '{{customerName}} {{trialEndDate}} {{packageName}}', 0, 0, 0, 1, NULL, NULL),
(7, 'Subscription Reminder', 'SUBSCRIPTION_REMINDER', 'Subscription Reminder', '<div style=\'font-family: Arial, sans-serif; font-size: 14px;\'> <h2 style=\'color: #333333;\'>Dot Accounts Renewal Reminder</h2> <p>Dear {{customerName}},</p> <p>We hope this email finds you well. We wanted to remind you that your subscription is expiring on {{expiryDate}}.</p> <p>If you want to continue using our service, please renew your subscription by visiting our website and selecting a subscription plan that suits your needs.</p> <p>If you have already renewed your subscription, please disregard this email. Otherwise, please renew your subscription before the expiry date to avoid any interruption in your service.</p> <p>If you have any questions or concerns, please do not hesitate to contact us. We are always here to help.</p> <p>Thank you for choosing our service. We appreciate your business and look forward to continuing to serve you.</p> </div>', '', '', '{{customerName}} {{expiryDate}} {{packageName}}', 0, 0, 0, 1, NULL, NULL),
(8, 'Subscription Payment Confirmation', 'SUBSCRIPTION_PAYMENT_CONFIRMATION', 'Subscription Payment Confirmation', '<div style=\'font-family: Arial, sans-serif; font-size: 14px;\'> <h2 style=\'color: #333333;\'>Dot Accounts Payment Confirmation</h2> <p>Dear {{customerName}},</p> <p>Thank you for renewing your subscription to (Package Name: {{packageName}}). Your payment has been received and your subscription has been renewed until {{expiryDate}}.</p> <p>You can now continue using our service without any interruption. If you have any questions or concerns, please do not hesitate to contact us. We are always here to help.</p> <p>Thank you for choosing our service. We appreciate your business and look forward to continuing to serve you.</p> </div>', '', '', '{{customerName}} {{expiryDate}} {{packageName}}', 0, 0, 0, 1, NULL, NULL);
