(1, 2, 'English---us', 'What is a SaaS system?', 'SaaS stands for Software as a Service, which is a cloud computing model where software is provided over the internet, and users access it through a web browser without having to install or maintain any software locally.', '2023-04-21 04:24:52', '2023-04-21 04:24:52'),
(2, 3, 'English---us', 'How do I sign up for a SaaS system?', 'To sign up for a SaaS system, simply visit our website and click on the \"Sign Up\" or \"Get Started\" button. Follow the prompts to create an account, choose a subscription plan, and provide payment information.', '2023-04-21 04:25:15', '2023-04-21 04:25:15');
